import React from "react";
import { todoType } from "../store/todoReducer";
import Item from "../Item/Item";

function TodoList({ todo }: { todo: todoType[] }) {
	return (
		<>
			{todo.map((ele) => (
				<Item key={ele.id} {...ele} />
			))}
		</>
	);
}

export default TodoList;
